  false,\n\t\"url\": null,\n\t\"notes\": \"ESCAMBIA: The Light Detection and Ranging
  (LiDAR) LAS dataset is a survey of select areas within Escambia County, Florida.
  These data were produced for Dewberry and Davis LLC. The Escambia County LiDAR Survey
  project area consists of approximately 803 square miles. The LiDAR point cloud was
  flown at a density sufficient to support a maximum final post spacing of 6 feet
  for unobscured areas. Land Air mapping acquired 110 flightlines between June 21,
  2006 and July 18, 2006. The data was divided into 5000' by 5000' foot cells that
  serve as the tiling scheme. The Escambia County LiDAR Survey was collected under
  the guidance of a Professional Mapper/Surveyor. Dates of Collection: 20060621-20060718
  Contractor: Dewberry and Davis, LLC SANTA ROSA: LiDAR data collection was performed
  utilizing a Leica ALS-50 sensor, collecting multiple return x, y, and z data as
  well as intensity data. LiDAR data was processed to achieve a bare ground surface.
  LiDAR data was delivered in LAS format. Dates of Collection: 20060112-20060228 Contractor:
  Photo Science, Inc. WALTON: LIDAR data is remotely sensed high-resolution elevation
  data collected by an airborne collection platform. Using a combination of laser
  range finding, GPS positioning and inertial measurement technologies; LIDAR instruments
  are able to make highly detailed Digital Elevation Models (DEMs) of the earth's
  terrain, man-made structures and vegetation. This data of Walton County, Florida,
  was collected at sub-meter resolution to provide average point spacing of 0.7m for
  collected points. Up to 5 returns were recorded for each pulse in addition to an
  intensity value. No data for Eglin AFB, permission to fly over was ever granted.
  Dates of Collection: 20060710-11, 19-20, 22-23, 26-29, 20060801, 03, 06-07, 13,
  15, 17 Contractor: Sanborn\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
